# Kendocup::Headline.destroy_all
Kendocup::Headline.create!([
  {id: 1, title_fr: "Des invités de marques", title_en: "Prominent figures at the tournament", content_fr: "<p>L'année 2014 marque le trentième anniversaire de la création de la coupe Kasahara. A cette occasion, la Fédération Suisse de Kendo a invité le fils de Kasahara Toshiaki sensei: <b>KASAHARA Hirohaki sensei</b> à venir assister à la compétition.</p>\r\n<p>Agé de 63 ans,  7-Dan Kyoshi et pratiquant Nito comme son père, Kasahara Hirohaki sensei sera accompagné par deux autres figures importantes de la Fédération de Kendo de Shinagawa: <b>HAYASHI Hiromichi sensei</b>, 67 ans, 7-Dan Kyoshi et <b>SANO Eiichi sensei</b> (67 ans), 7-Dan Kyoshi.</p>\r\n<p>Nous nous réjouissons d'accueillir ces trois personnalités qui prendront part évidemment à l'arbitrage de la compétition mais aussi au Ji-Geiko du samedi soir.</p>", content_en: "<p>2014 marks the thirtieth anniversary of the creation of the Kasahara Cup in Switzerland. On this occasion, the Swiss Kendo Federation has invited the son of Kasahara Toshiaki sensei: <b>KASAHARA Hirohaki sensei</b> to assist to the competition.</p>\r\n<p>Now 63, 7-Dan Kyoshi and practicing Nito like his father, Kasahara Hirohaki sensei will be accompanied by two other important figures of the Shinagawa Kendo Federation: <b>HAYASHI Hiromichi sensei</b>, 67, 7-Dan Kyoshi and <b>SANO Eiichi sensei</b>, 67, 7-Dan Kyoshi.</p>\r\n<p>We are delighted to welcome these three personalities who will take part to the competition as referees, but also to Saturday night's Ji-Geiko.</p>", cup_id: 3, shown: true, created_at: "2014-09-03 21:01:46", updated_at: "2014-09-03 21:03:21"}
])
